import React, { useState } from 'react'
import Head from 'next/head'
import { makeStyles } from '@material-ui/core/styles'
import TextField from '@material-ui/core/TextField';
import Box from '@material-ui/core/Box';
import Card from '@material-ui/core/Card';
import Typography from "@material-ui/core/Typography";
import IconButton from "@material-ui/core/IconButton";

import PeopleIcon from '@material-ui/icons/People';

import TourneyIcon from '../images/tournament.svg';

import styles from '../styles/Home.module.css'

const useStyles = makeStyles({
   root: {},
   button: {
       width: '150px',
       height: '150px',
       borderStyle: 'solid',
       '&:hover': {
          color: 'blue',
           cursor: 'pointer'
       }

   }
})

export default function Home() {
  const classes = useStyles();

  return (
    <Box className={styles.container}>
      <Head>
        <title>League Tourney</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <main className={styles.main}>
        <h1 className={styles.title}>
          Welcome to <span className={styles.link}>brakkit.gg</span>
        </h1>
        <p className={styles.description}>
          Created by Shane McGraw
        </p>
        <Box>
            <Box display="flex" flexDirection="column" alignItems="center" className={classes.button}>
                <Typography>
                    Generate Bracket
                </Typography>
                <TourneyIcon />
            </Box>
        </Box>
      </main>
    </Box>
  )
}
